where.expression:
NOT (relation_type IN ['decomposition', 'specialization', 'occurrence']
    ) OR aggregate1_in_aggregate2(TYPEOF(related), TYPEOF(relating)) OR 
    aggregate1_in_aggregate2(TYPEOF(relating), TYPEOF(related))

rule.algorithm:
LOCAL
  ndea_set : SET OF effectivity_assignment := [];
END_LOCAL;
  ndea_set := QUERY(ea <* effectivity_assignment | NOT (
  'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.DATED_EFFECTIVITY'
   IN TYPEOF(ea.assigned_effectivity)));

where.expression:
SIZEOF(QUERY(p <* product | SIZEOF(QUERY(pv1 <* USEDIN(p, 
    'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.PRODUCT_VERSION.OF_PRODUCT'
    ) | SIZEOF(QUERY(pv2 <* USEDIN(p, 
    'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.PRODUCT_VERSION.OF_PRODUCT'
    ) | pv1.id = pv2.id)) > 1)) > 0)) = 0

SIZEOF(QUERY(pv <* product_version | SIZEOF(QUERY(pvd1 <* USEDIN(pv, 
    'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.PRODUCT_VIEW_DEFINITION.DEFINED_VERSION'
    ) | SIZEOF(QUERY(pvd2 <* USEDIN(pv, 
    'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.PRODUCT_VIEW_DEFINITION.DEFINED_VERSION'
    ) | pvd1.id = pvd2.id)) > 1)) > 0)) = 0

function.algorithm:
LOCAL
  x : SET OF representation_relationship;
END_LOCAL;
  IF relation.rep_1 IN relatives THEN
    RETURN (FALSE);
  END_IF;
  x := QUERY(r <* bag_to_set(USEDIN(relation.rep_1, 
  'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.REPRESENTATION_RELATIONSHIP.REP_2'
  )) | specific_relation IN TYPEOF(r));
  REPEAT i := 1 TO HIINDEX(x);
    IF NOT acyclic_representation_relationship(x[i], relatives + relation.rep_1
    , specific_relation) THEN
      RETURN (FALSE);
    END_IF;
  END_REPEAT;
  RETURN (TRUE);

LOCAL
  the_set : SET OF GENERIC : intype := [];
  i : INTEGER;
END_LOCAL;
  IF SIZEOF(the_bag) > 0 THEN
    REPEAT i := 1 TO HIINDEX(the_bag);
      the_set := the_set + the_bag[i];
    END_REPEAT;
  END_IF;
  RETURN (the_set);

LOCAL
  i : INTEGER;
  td : length_measure := 0;
END_LOCAL;
  REPEAT i := 1 TO swsrh.segments;
    td := td + swsrh.segment_depths[i];
  END_REPEAT;
  RETURN (td);

IF 
  'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.CLASS_CONDITION_ASSOCIATION'
   IN TYPEOF(config.is_solution_for) THEN
    IF config.configuration_type = configuration_kind.usage THEN
      RETURN (config.is_solution_for\class_condition_association.condition_type
       = 'part usage');
    ELSE
      RETURN (config.is_solution_for\class_condition_association.condition_type
       = 'design case');
    END_IF;
  END_IF;
  IF 
  'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.CLASS_SPECIFICATION_ASSOCIATION'
   IN TYPEOF(config.is_solution_for) THEN
    IF config.configuration_type = configuration_kind.usage THEN
      RETURN (config.is_solution_for\class_specification_association.
      association_type = 'part usage');
    ELSE
      RETURN (config.is_solution_for\class_specification_association.
      association_type = 'design case');
    END_IF;
  END_IF;
  RETURN (FALSE);

IF 
  'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.ABSTRACT_VARIABLE'
   IN TYPEOF(x) THEN
    RETURN (TRUE);
  ELSE
    IF (
    'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.FUNC'
     IN TYPEOF(x)) AND (SIZEOF(QUERY(y <* x.terms | contains_variable(y))) > 0)
     THEN
      RETURN (TRUE);
    ELSE
      RETURN (FALSE);
    END_IF;
  END_IF;

LOCAL
  dd : SET OF document_definition := [];
  da : SET OF document_assignment := [];
END_LOCAL;
  da := bag_to_set(QUERY(dr <* USEDIN(input, 
  'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.DOCUMENT_ASSIGNMENT.IS_ASSIGNED_TO'
  ) | dr.role = role));
  REPEAT i := 1 TO SIZEOF(da);
    IF type_name IN TYPEOF(da[i].assigned_document) THEN
      dd := dd + da[i].assigned_document;
    END_IF;
  END_REPEAT;
  RETURN (dd);

LOCAL
  sda : SET OF shape_description_association := [];
  gm : SET OF geometric_model := [];
END_LOCAL;
  sda := bag_to_set(USEDIN(input, 
  'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.SHAPE_DESCRIPTION_ASSOCIATION.REPRESENTED_CHARACTERISTIC'
  ));
  REPEAT i := 1 TO SIZEOF(sda);
    gm := gm + sda[i].representation;
  END_REPEAT;
  RETURN (gm);

IF (year MOD 4 = 0) AND (year MOD 100 <> 0) OR (year MOD 400 = 0) THEN
    RETURN (TRUE);
  ELSE
    RETURN (FALSE);
  END_IF;

LOCAL
  i : INTEGER;
  j : INTEGER;
  k : INTEGER;
END_LOCAL;
  IF (
  'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.ABSTRACT_VARIABLE'
   IN TYPEOF(thing)) AND (
  'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.RULE_DEFINITION'
   IN TYPEOF(thing.scope)) THEN
    accum := accum + thing;
  ELSE
    IF 
    'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.RULE_CONDITION'
     IN TYPEOF(thing) THEN
      REPEAT i := 1 TO HIINDEX(thing\atomic_formula.terms);
        accum := local_vars_aux(thing\atomic_formula.terms[i], accum);
      END_REPEAT;
    ELSE
      IF 
      'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.SIMPLE_CLAUSE'
       IN TYPEOF(thing) THEN
        REPEAT j := 1 TO HIINDEX(thing.formulas);
          accum := local_vars_aux(thing.formulas[j], accum);
        END_REPEAT;
      ELSE
        IF 
        'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.COMPLEX_CLAUSE'
         IN TYPEOF(thing) THEN
          REPEAT k := 1 TO HIINDEX(thing.clauses);
            accum := local_vars_aux(thing.clauses[k], accum);
          END_REPEAT;
        END_IF;
      END_IF;
    END_IF;
  END_IF;
  RETURN (accum);

LOCAL
  accum : SET OF scalar_variable := [];
END_LOCAL;
  RETURN (local_vars_aux(thing, accum));

LOCAL
  result : SET OF STRING := [];
END_LOCAL;
  REPEAT i := 1 TO HIINDEX(items);
    result := result + TYPEOF(items[i]);
  END_REPEAT;
  RETURN (result);

LOCAL
  category_assignments :  BAG  OF product_category_assignment;
  categories : SET OF STRING := [];
  i : INTEGER;
END_LOCAL;
  category_assignments := USEDIN(obj, 
  'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.PRODUCT_CATEGORY_ASSIGNMENT.PRODUCTS'
  );
  REPEAT i := LOINDEX(category_assignments) TO HIINDEX(category_assignments);
    categories := categories + category_assignments[i].category.name;
  END_REPEAT;
  RETURN (categories);

CASE rep.name OF 
     'document content' : 
      BEGIN
        RETURN (SIZEOF(QUERY(items <* rep\representation.items | NOT (items.
        name IN ['detail level', 'geometry type', 'real world scale']))) = 0);
      END;
     'document creation' : 
      BEGIN
        IF NOT (SIZEOF(QUERY(items <* rep\representation.items | NOT (items.
        name IN ['creating interface', 'creating system', 'operating system']))
        ) = 0) THEN
          RETURN (FALSE);
        END_IF;
        IF NOT (SIZEOF(QUERY(items <* rep\representation.items | NOT (items.
        name IN ['creating system']))) = 1) THEN
          RETURN (FALSE);
        ELSE
          RETURN (TRUE);
        END_IF;
      END;
     'document format' : 
      BEGIN
        RETURN (SIZEOF(QUERY(items <* rep\representation.items | NOT (items.
        name IN ['character code', 'data format', 'size format', 
        'size format standard']))) = 0);
      END;
     'document size' : 
      BEGIN
        RETURN (SIZEOF(QUERY(items <* rep\representation.items | NOT (items.
        name IN ['file size', 'page count']))) = 0);
      END;
    OTHERWISE  : RETURN (UNKNOWN);
  END_CASE;
